import {
  PagesTopTitle,
  UserName,
  InfoCard,
  EmployeesChart,
  CalendarApp,
  HolidaysApp,
  CelebrationsApp,
  WhoAwayApp,
  WorkingFormatChart,
  ApprovalsCard,
} from "../components/Pages/Dashboard/index";
import CardIconImg from "../../../pics/profile.jpeg";
import CardIconImg2 from "../../../pics/profile2.jpeg";
import { IoEllipsisVerticalSharp } from "react-icons/io5";
const Dashboard = () => {
  const ApprovalsCardData = [
    {
      toptitle: "Today(01)",
      cat1: [
        {
          userImg: CardIconImg,
          name: "Sonali Bhagat",
          DOB: "Printer:INR 2400",
          link: "/",
        },
        {
          userImg: CardIconImg2,
          name: "Sonali Bhagat",
          DOB: "Printer:INR 2400",
          link: "/",
        },
      ],
    },
    {
      toptitle: "Today(01)",
      cat1: [
        {
          userImg: CardIconImg2,
          name: "Sonali Bhagat",
          DOB: "Printer:INR 2400",
          link: "/",
        },
        {
          userImg: CardIconImg,
          name: "Sonali Bhagat",
          DOB: "Printer:INR 2400",
          link: "/",
        },
      ],
    },
  ];

  return (
    <>
      <div className="custom_container">
        <UserName />
        <PagesTopTitle title="dashbaord" />

        <div className="row g-4">
          <InfoCard />
          <EmployeesChart />
          <WorkingFormatChart />
          <WhoAwayApp />
          <CelebrationsApp />
          <HolidaysApp />
          <CalendarApp />
        </div>
        <PagesTopTitle title="Request for Approvals" />
        <div className="row g-4">
          <ApprovalsCard
            data={ApprovalsCardData}
            title="test"
            ApprovalsCardIcon={<IoEllipsisVerticalSharp />}
          />
        </div>
      </div>
    </>
  );
};

export default Dashboard;
